import React from 'react'
import Video  from "./Video";
import Gallery from 'react-photo-gallery';

/* <Video key={img} image={`../../images/music/${img}.jpg`} /> */

const VideoGrid = () => {

    const photos = [
        {
          src: "https://i.imgur.com/YZg8WH5.jpg",
          width: 4,
          height: 3
        },
        {
          src: "https://i.imgur.com/NW7WrXm.jpg",
          width: 1,
          height: 1
        },
                {
          src: "https://i.imgur.com/BByoNYe.jpg",
          width: 4,
          height: 3
        },
        {
          src: "https://i.imgur.com/dUkGW2n.jpg",
          width: 1,
          height: 1
        },
        {
          src: "https://i.imgur.com/8auDKOM.jpg",
          width: 4,
          height: 3
        },
        {
          src: "https://i.imgur.com/KIIDqoM.jpg",
          width: 1,
          height: 1
        },
        {
            src: "https://i.imgur.com/4xPeASw.jpg",
            width: 4,
            height: 3
        },

      ];



    return (
        <div className="ml-2 mr-2">
            <Gallery 
                photos={photos}
                direction="row"
            />


        </div>
    )
}

export default VideoGrid
